  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112324 includes Surface
  underway, chemical, meteorological, physical and time series data collected from
  NATHANIEL B. PALMER and ROGER REVELLE in the South Atlantic Ocean and South Pacific
  Ocean from 1994-11-01 to 1998-04-30. These data include BAROMETRIC PRESSURE, Partial
  pressure (or fugacity) of carbon dioxide - atmosphere, Partial pressure (or fugacity)
  of carbon dioxide - water, SALINITY, SEA SURFACE TEMPERATURE and WATER TEMPERATURE.
  The instruments used to collect these data include Bubble type equilibrator for
  autonomous carbon dioxide (CO2) measurement, Carbon dioxide (CO2) gas analyzer and
  Shower head chamber equilibrator for autonomous carbon dioxide (CO2) measurement.nnThese
  data were collected by Taro Takahashi of Columbia University; Lamont-Doherty Earth
  Observatory as part of the 9406sfc (Ross Sea), 9604sfc (Site Survey), 9605sfc (Mooring
  Deployment), 9606sfc (Ross Sea, ROAVERRS), 9701sfc (Ross Sea Process II), 9703sfc
  (Ross Sea Process III), 9708sfc (Ross Sea Process IV), 9802sfc (Benthic Process
  ), kiw8sfc (APFZ Survey II) and kiw9sfc (APFZ Process II) data set. CDIAC assigned
  the following cruise ID(s) to this data set: 33RR19980101, 33RR19980201, 9406sfc
  (Ross Sea Bio Study), 9604sfc (Site Survey), 9605sfc (Mooring Deployment), 9606sfc
  (Ross Sea, 9701sfc (Ross Sea Process II), 9703sfc (Ross Sea Process III), 9708sfc
  (Ross Sea Process IV), 9802sfc (Benthic Process ) and ROAVERRS).nnThe Global CO2
  Time-series and Moorings Project involves international groups from 18 countries
  who have mounted sensors on moored buoys to provide high resolution time-series
  measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
  (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
  Ocean Carbon Coordination Project (IOCCP).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
